import React from "react";
import {Link} from "react-router-dom";
import "../../../map.css";
import "./style.css";

function Index () {    

    let linkRay = [];

    for (var i = 0; i < 26; i++) {
            linkRay.push(
                    <Link to={{
                        pathname: "/list/genus/" + String.fromCharCode(i + 97),
                        state : {
                            page: "list",
                            plants: [],
                            title: "Scientific Names by Genus",
                            subtitle: "Results",
                            header: "Browsing - ",
                            selection: String.fromCharCode(i + 65)
                          }
                    }}>{String.fromCharCode(i + 97)}</Link>
             ); 
        }
        return (
            <div id="selectors">
                {linkRay}
            </div>
        );
    }

export default Index;

